class Solution {
    func minSum(_ nums1: [Int], _ nums2: [Int]) -> Int {
        let sum1 = nums1.reduce(0, +)
        let sum2 = nums2.reduce(0, +)
        let zeros1 = nums1.filter { $0 == 0 }.count
        let zeros2 = nums2.filter { $0 == 0 }.count

        if sum1 == sum2 {
            return sum1 + max(zeros1, zeros2)
        } else if sum1 > sum2 {
            if zeros2 == 0 {
                return -1
            } else {
                let diff = sum1 - sum2 + zeros2
                if diff % zeros2 == 0 {
                    return sum1 + zeros1
                } else {
                    return -1
                }
            }
        } else { // sum2 > sum1
            if zeros1 == 0 {
                return -1
            } else {
                let diff = sum2 - sum1 + zeros1
                if diff % zeros1 == 0 {
                    return sum2 + zeros2
                } else {
                    return -1
                }
            }
        }
    }
}
